import { Action } from "@remix-run/router";
import { act } from "react-dom/test-utils";

const initialState = [
  {
    id: 1,
    firstName: "Abera",
    lastName: "Melkamu",
    email: "abe@example.com",
    salary: "3000",
    age: "21",
    gender: "M",
    height: "1.75m",
  },
  {
    id: 2,
    firstName: "Tayetu",
    lastName: "Betul",
    email: "tayetu@example.com",
    salary: "6000",
    age: "25",
    gender: "F",
    height: "1.55m",
  },
  {
    id: 3,
    firstName: "Berihun",
    lastName: "Aschale",
    email: "beriew@example.com",
    salary: "8000",
    age: "30",
    gender: "M",
    height: "1.60m",
  },
  {
    id: 4,
    firstName: "Hayat",
    lastName: "Abdurehmah",
    email: "Hayu@example.com",
    salary: "7000",
    age: "26",
    gender: "F",
    height: "1.65m",
  },
  {
    id: 5,
    firstName: "Ebrahim",
    lastName: "Awol",
    email: "eba@example.com",
    salary: "9000",
    age: "30",
    gender: "M",
    height: "1.80m",
  },
];

const employeReducer = (state = initialState, action) => {
  switch (action.tye) {
    default:
      return state;
  }
};

export default employeReducer;
